import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Account.css';

const Account = () => {
  const [userData, setUserData] = useState(null);
  const [epicGamesName, setEpicGamesName] = useState('');
  const [customId, setCustomId] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      const token = sessionStorage.getItem('userData')
        ? JSON.parse(sessionStorage.getItem('userData')).accessToken
        : null;

      if (!token) {
        console.error('No token found in sessionStorage');
        return;
      }

      try {
        console.log('Sending GET request to /account with token:', token);
        const response = await axios.get('http://localhost:5000/account', {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log('Response from /account:', response.data);

        setUserData(response.data);
        setEpicGamesName(response.data.epicGamesName || '');
        setCustomId(response.data.customId || '');
      } catch (err) {
        console.error('Error fetching user data:', err.response?.data || err.message);
        setErrorMessage('Failed to load account data.');
      }
    };

    fetchData();
  }, []);

  const handleUpdate = async () => {
    const token = sessionStorage.getItem('userData')
      ? JSON.parse(sessionStorage.getItem('userData')).accessToken
      : null;

    if (!token) {
      console.error('No token found in sessionStorage for update');
      return;
    }

    try {
      console.log('Sending POST request to /account/update with data:', { epicGamesName, customId });
      const response = await axios.post(
        'http://localhost:5000/account/update',
        { epicGamesName, customId },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      console.log('Response from /account/update:', response.data);
      setSuccessMessage('Account updated successfully!');
      setErrorMessage('');
    } catch (err) {
      console.error('Error updating account:', err.response?.data || err.message);
      setErrorMessage('Failed to update account. Please try again.');
    }
  };

  if (!userData) return <p>Loading...</p>;

  return (
    <div className="account-container">
      <h2>Account</h2>

      <div className="account-section">
        <h3>Discord</h3>
        <p><strong>Discord Username:</strong> {userData.discordName}</p>
        <p><strong>Discord ID:</strong> {userData.discordId}</p>
      </div>

      <div className="account-section">
        <h3>Epic Games</h3>
        <input
          type="text"
          placeholder="Enter Epic Games Username"
          value={epicGamesName}
          onChange={(e) => setEpicGamesName(e.target.value)}
        />
      </div>

      <div className="account-section">
        <h3>Custom ID</h3>
        <input
          type="text"
          placeholder="Enter Custom ID"
          value={customId}
          onChange={(e) => setCustomId(e.target.value)}
        />
      </div>

      <div className="account-section">
        <h3>Game Statistics</h3>
        <p><strong>Wins:</strong> {userData.wins || 0}</p>
        <p><strong>Losses:</strong> {userData.losses || 0}</p>
      </div>

      <button onClick={handleUpdate} className="update-button">Update</button>

      {successMessage && <p className="success-message">{successMessage}</p>}
      {errorMessage && <p className="error-message">{errorMessage}</p>}
    </div>
  );
};

export default Account;
